import React, { useEffect, useState } from 'react';
import axios from 'axios';
import NavBar from '../components/NavBar';
import './css/admin.css';
import './css/main.css';
import './css/common-code.css';

const BASE_URL = process.env.REACT_APP_BASE_URL;

export default function CommonCodePage() {
  const [codes, setCodes] = useState([]);
  const [selectedCode, setSelectedCode] = useState(null);
  const [detailModalOpen, setDetailModalOpen] = useState(false);
  const [details, setDetails] = useState([]);

  useEffect(() => {
    fetchCodes();
  }, []);

  const fetchCodes = async () => {
    try {
      const res = await axios.get(`${BASE_URL}/users/admin/codes`, { withCredentials: true });
      setCodes(res.data);
    } catch (err) {
      console.error('❌ 코드 목록 불러오기 실패:', err);
    }
  };

  const handleRowClick = async (code) => {
    setSelectedCode(code);
    try {
      const res = await axios.get(`${BASE_URL}/codes/${code.code_id}/details`, { withCredentials: true });
      setDetails(res.data);
      setDetailModalOpen(true);
    } catch (err) {
      console.error('❌ 세부 코드 조회 실패:', err);
    }
  };

  const closeModal = () => {
    setDetailModalOpen(false);
    setSelectedCode(null);
    setDetails([]);
  };

  return (
    <>
      <NavBar />
      <div className="admin-wrapper">
        <div className="admin-inner">
          <h2 className="section-title">공통 코드 관리</h2>
          <div className="scroll-table-container">
            <table className="admin-table">
              <colgroup>
                <col style={{ width: '15%' }} />
                <col style={{ width: '45%' }} />
                <col style={{ width: '20%' }} />
                <col style={{ width: '20%' }} />
              </colgroup>
              <thead>
                <tr>
                  <th>코드ID</th>
                  <th>코드명</th>
                  <th>등록자</th>
                  <th>등록일</th>
                </tr>
              </thead>
              <tbody>
                {codes.map((code) => (
                  <tr key={code.code_id} onClick={() => handleRowClick(code)} style={{ cursor: 'pointer' }}>
                    <td>{code.code_id}</td>
                    <td>{code.code_name}</td>
                    <td>{code.reg_id}</td>
                    <td>{code.reg_date}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          {detailModalOpen && (
            <div className="modal-overlay" onClick={closeModal}>
              <div className="modal-content" onClick={(e) => e.stopPropagation()}>
                <div className="modal-header">
                  <h3>세부 코드 목록 - {selectedCode.code_name}</h3>
                  <button onClick={closeModal} className="close-button">X</button>
                </div>
                <table className="admin-table">
                  <thead>
                    <tr>
                      <th>Detail Code</th>
                      <th>Detail Name</th>
                      <th>등록자</th>
                      <th>등록일</th>
                    </tr>
                  </thead>
                  <tbody>
                    {details.map((detail, idx) => (
                      <tr key={idx}>
                        <td>{detail.detail_code}</td>
                        <td>{detail.detail_name}</td>
                        <td align="left">{detail.reg_id}</td>
                        <td>{detail.reg_date}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          )}
        </div>
      </div>
    </>
  );
}
